import React, { Fragment } from 'react'
import { useParams ,Route } from 'react-router-dom'
import Comments from '../components/comments/Comments'

function QuoteDetail() {
  const params=useParams()
  return (
   <Fragment>


     <h1>Quote Details!!</h1>
     <p>{params.quoteId}</p>
     <Route></Route>

   </Fragment>
    
  )
}

export default QuoteDetail
